const fs = require('fs');
import { MD5 } from 'crypto-js';

let pvk = fs.readFileSync('keys/private.key', 'utf8');

const nodeEnv = process.env.NODE_ENV || 'development';

const publicKey = nodeEnv === 'development' ? 'b50abba380e2d7526a8f2976d414d3ad' : process.env.PUBLIC_KEY;
const privateKey = nodeEnv === 'development' ? 'fb169aa00e7df048c545f2f3b05f9b5317bde1b1' : process.env.PRIVATE_KEY;

const ts = new Date().getTime();
const hash = MD5(ts + privateKey + publicKey);

export {
  publicKey, ts, hash
}
